description:
The time is not far distant when the test will come to every soul. The mark of the beast will be urged upon us. Those who have step by step yielded to worldly demands and conformed to worldly customs will not find it a hard matter to yield to the powers that be, rather than subject themselves to derision, insult, threatened imprisonment, and death.  {5T 81.1}  
As the movement for Sunday enforcement becomes more bold and decided, the law will be invoked against commandment keepers. They will be threatened with fines and imprisonment, and some will be offered positions of influence, and other rewards and advantages, as inducements to renounce their faith. {GC 607.1} 
Those who honor the Bible Sabbath will be denounced as enemies of law and order, as breaking down the moral restraints of society, causing anarchy and corruption, and calling down the judgments of God upon the earth. Their conscientious scruples will be pronounced obstinacy, stubbornness, and contempt of authority. They will be accused of disaffection toward the government. {GC 592.1}
